import {BUY_CAKE} from './cakeType'
const intialState={
       cakes:[
        { name:'chocolet cake',
        type:'fasting',
        numOfCake:10
       },
       { name:'chocolet cake',
        type:'fasting',
        numOfCake:10
       },
    { name:'chocolet cake',
       type:'fasting',
        numOfCake:10
        }
       ],

    //    cake:{ 
    //     name:'chocolet cake',
    //     type:'fasting',
    //     numOfCake:10
    //    }

}

const reducer = (state = intialState,action)=>{
       const cake = state.cake
    //    console.log('reducer' , cake.numOfCake)
     switch(action.type){
        case BUY_CAKE:{
            return{
                ...cake,
                numOfCake:state.cake.numOfCake - 1 
            }
        }
        default:return cake
     }
    }
export default reducer
